INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Nurul Rejeki', 4, 'Siadjirah Coffee is a cafe located on the edge of Mattirotasi beach. The atmosphere is quite pleasant. The interior is cute and instagrammable, with a vintage concept. There are 3 floors and there are no smoking areas. The food is quite tasty and the portions are large, although many of the menus are empty. OK.', 'Coffee', 'Positif', 'Siadjirah');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Yuliana Rahmawati', 4, 'You need to appreciate the cafe''s vintage and unfinished style design. Moreover, the arrangement of cassettes on the stairs to the 2nd floor is very authentic. The food and drinks I ordered were okay. Especially the melon lime squash is very fresh in the heat of the day. Maybe a little improvement in service would be better. At that time, I ordered grilled chicken at 2 pm, but it hadn''t arrived until 3 o''clock. Ask the waiter, apparently the chef forgot. Just to remind you.', 'Beverages', 'Positif', 'Siadjirah');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Anshor Muhajir', 4, 'One of the cafes that is quite busy in this city, there are air-conditioned rooms available too. The drinks are standard, nothing unique, there are quite a lot of snacks so lots of choices. The atmosphere was a bit noisy because there was a fan noise in the non-air-conditioned room.', 'Beverages', 'Positif', 'Siadjirah');
